description:
Bán nhà mặt phố Trung Hòa, Cầu Giấy: 
- DT 92m2, MT 5m, nhà xây 5 tầng nổi, 1 tầng hầm, thang máy xịn; 
- Nhà đẹp, hiện đại, mỗi tầng 1 phòng. Hai mặt thoáng trước và sau. Hiện đang cho thuê 65tr/th; 
- Vị trí đẹp; vỉa hè rộng, đường 20m; Thông ra phố Trung Hòa, Vũ Phạm Hàm, TRung Kính, Hạ Yên.... Ngay sát KĐT Yên Hòa( Là KĐT Vip nhất Hà Nội - toàn các lãnh đạo TƯ ở).
- Hướng Tây nam; 
- Gía 45 tỷ có thương lượng.
Cảm ơn đã đọc tin!
